import React, { Component } from "react"

class App extends Component {
    constructor() {
        super()
        this.state = {
            individual: {}

        }
    }
    componentDidMount() {
        this.setState()
        fetch("https://raw.githubusercontent.com/VSchool/vschool-api/master/static/hitlist.json")
            .then(response => response.json())
            .then(data => {
                this.setState({
                    individual: data
                })
            })


    }

    render() {
        return (
            <div>
                {this.state.individual.name}
            </div>

        )
    }

}

export default App
